description:
Sugar Cube : Bittersweet Factory is a 2D platformer game that presents the story of a sugar cube. A cube of sugar escapes the factories to avoid the fate of being a cookie! The backgrounds of the game have two sides, namely, the front and the back. So depending on how you play, the environments will very often be vastly different. The game is full version of IGF China 2010 winner, Sugar Cube. Includes 5 factory themes containing 90 levels and 2 endings. 
